import React from 'react'
import '../css/header.css'
import Navbar from "./Navbar";

const Header = () => {
  return (
    <div className='header'>
          <Navbar />
          <div className="appointment">
            <h2>Kamil's Barber Shop</h2>
          </div>
    </div>
  )
}

export default Header
